import React from 'react';

function Food({fav}) {

  return (
    <h3>
      I like {fav}. <br></br>
    </h3>
  );
}

const foodList = [
  {
    name: "food1",
    image: ""
  },
  {
    name: "food2",
    image: ""
  },
  {
    name: "food3",
    image: ""
  }
]

function App() {
  return (
    <div className="App">
      {foodList.map(el => <Food name={el.name}/>)}
    </div>
  );
}


export default App;
